import React from "react";
const Input = ({
  name,
  type,
  placeholder,
  value,
  onChange,
  error,
  isValid
}) => {
  return (
    <input
      name={name}
      type={type}
      placeholder={placeholder}
      value={value}
      onChange={onChange}
      error={error}
      isValid={isValid}
    />
  );
};
export default Input;
